import React from "react";
import "../style.css";

function Footer() {
  return (
    <div className="content">
    <footer className="footer">
      <span>
          <button className="homeDiv fBtn">Log Out</button>
      </span>
    </footer>
    </div>
  );
}

export default Footer;
